import logo from './logo.svg';
import './App.css';
import Calender from './calender';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Task from './task';

function App() {
  return (
    <div >
      <Router>
        <Switch>
       <Route path="/" exact>
       <Calender></Calender>
       </Route>
       <Route path="/task/:id">
         <Task></Task>
       </Route>
       </Switch>
      </Router>
    </div>
  );
}

export default App;
